import React, { Component } from "react";
import Vato from "./Vato";

class Katro extends Component {

    render() {

        return (
            <>
                <div className="test">
                    <h1>{this.props.title}</h1>
                </div>
                <div className="bg-info rounded-circle rond"></div>
            </>
        )
    }
}

export default Katro;
